import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../Styles/Navbar.css';

export default function Navbar() {
  const { isAuthenticated, login, logout, user } = useAuth();
  const navigate = useNavigate();

  return (
    <nav className="navbar" aria-label="Main navigation">
      <div className="navbar-links">
        <Link to="/" className="navbar-link">Home</Link>
        <Link to="/search" className="navbar-link">Search</Link>
        {isAuthenticated && <Link to="/recommend" className="navbar-link">Recommended</Link>}
        {isAuthenticated && <Link to="/bookmarks" className="navbar-link">Bookmarks</Link>}
      </div>
      <div className="navbar-right">
        {!isAuthenticated ? (
          <button onClick={login} className="navbar-button" aria-label="Login">Login</button>
        ) : (
          <>
            <button onClick={() => navigate('/profile')} className="navbar-button" aria-label="Profile">
              Hi, {(user?.name || 'User').toUpperCase()}
            </button>
            <button onClick={logout} className="navbar-button" aria-label="Logout">Logout</button>
          </>
        )}
      </div>
    </nav>
  );
}
